var wp_custom;(e=>{wp_custom={init:function(){this.headerMenu(),this.faq()},headerMenu:function(){let e=document.querySelector(".menu-toggle"),t=document.querySelector(".menu");document.querySelector(".hamburger-icon");e.addEventListener("click",()=>{t.classList.toggle("open"),e.classList.toggle("open")})},faq:function(){let e=document.querySelectorAll(".faq-question");e.forEach(t=>{t.querySelector(".faq-q").addEventListener("click",()=>{e.forEach(e=>{e!==t&&e.classList.contains("open")&&e.classList.remove("open")}),t.classList.toggle("open")})})}},e(document).ready(function(){wp_custom.init()})})(jQuery);